    data: |
      SELECT ALL - ( ( + ( - col0 ) ) ) AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( NOT + col2 NOT IN ( - ( + col2 ), - col0 + - + col2 + col1 * + - col2 ) );
  - name: tab1

outputs:
  - name: q12196.out
    data: |
